        '<p class="t" data-v-096fa13e>1. 報名規則</p><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>1.1</div><div class="flex-item" data-v-096fa13e> 所有英雄都可以參與擂臺爭霸賽；<br data-v-096fa13e> 英雄參賽說明：在每一輪比賽中（每發放一次冠軍獎勵視為一輪），同一個英雄會有參賽次數限製。<br data-v-096fa13e> 1-4級英雄1次；<br data-v-096fa13e> 5-12級英雄每升一級多一次. </div></div><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>1.2</div><div class="flex-item" data-v-096fa13e> 在英雄參賽時需繳納報名費，報名費初始金額為0.1BNX，逐步上升。<br data-v-096fa13e> 報名費用計算公式=0.1+2.9*(1-5000/(5000+報名序列))^2。<br data-v-096fa13e> *所有參與者的報名費用都將進入獎池；<br data-v-096fa13e> *報名序號以合約付款順序為準；<br data-v-096fa13e></div></div><p class="t" data-v-096fa13e>2. 比賽規則：</p><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>2.1</div><div class="flex-item" data-v-096fa13e> 挑戰規則<br data-v-096fa13e> 初始第一名報名的玩家將成為本輪擂主，後續報名的玩家按照報名順序逐一挑戰擂主。挑戰擂主成功則接替擂主位置成為新擂主。按照此順序持續戰鬥，持續戰鬥的過程中，英雄的生命值無法恢復。 </div></div><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>2.2</div><div class="flex-item" data-v-096fa13e> 積分規則<br data-v-096fa13e> 在戰鬥過程中，每擊敗一名對手可以獲得1點積分，戰鬥失敗獎獲得2點積分；<br data-v-096fa13e> 同一地址所有參賽英雄的積分累計計算；<br data-v-096fa13e> 每挑戰1000場，已參賽玩家所獲總積分均增長10%； </div></div><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>2.3</div><div class="flex-item" data-v-096fa13e> 當一名英雄占領擂主位超過30分鐘且沒有任何挑戰者時，本輪擂臺賽結束並向所有參與者發放獎勵。 </div></div><p class="t" data-v-096fa13e>3. 擂台賽的獎池將會按照以下比例分配：</p><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e></div><div class="flex-item" data-v-096fa13e> 擂臺賽大獎池：玩家參賽報名費的90%將會進入到大獎池。在擂臺賽結束時，將會按照以下比例分配：<br data-v-096fa13e> 40%：最終的冠軍獎勵；<br data-v-096fa13e> 30%：所有參賽者按照參賽積分比例分配；<br data-v-096fa13e> 20%：進入下一輪擂臺賽的初始大獎池；<br data-v-096fa13e> 10%：燃燒銷毀；<br data-v-096fa13e> 首輪擂臺賽開始時，團隊將向大獎池註入20000個BNX作為初始的大獎池。<br data-v-096fa13e><br data-v-096fa13e> 快速分紅獎池：報名費的10%進入快速分紅獎池，每有1000名英雄報名，將自動進行一次快速分配，即驚喜獎池當前余額分配給所有已參賽的玩家； </div></div><p class="t" data-v-096fa13e>4. 補充規則：</p><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>4.1</div><div class="flex-item" data-v-096fa13e> 初始戰鬥的時間間隔為30s，等待挑戰者的倒計時為30分鐘。 </div></div><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>4.2</div><div class="flex-item" data-v-096fa13e> 在擂臺賽結束後將由項目團隊對比賽結果進行確認，若比賽為正常結束，則按照規則結束比賽並發放獎勵，若因BSC網絡故障，他人惡意攻擊等原因導致的異常結束，則將保留原比賽結果並重新開始一輪等待挑戰者的倒計時； </div></div><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>4.3</div><div class="flex-item" data-v-096fa13e> 根據比賽的進度情況，團隊保留對戰鬥的時間間隔和等待挑戰者的倒計時時長進行調整的權利。在調整時會提前通過社區和Announce channel進行通知。 </div></div>',
