        '<p class="t" data-v-096fa13e>1. Registration Rules</p><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>1.1</div><div class="flex-item" data-v-096fa13e> All heroes can participate. In each round of the competition (every time the championship award is issued is regarded as a round), the same hero will have a limit on the number of entries. 1 time for level 1-4 heroes, one more time for level 5-12 heroes each level up.<br data-v-096fa13e></div></div><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>1.2</div><div class="flex-item" data-v-096fa13e> The registration fee must be paid when the hero participates. The initial amount of the registration fee is 0.1BNX, and then gradually increases. The subsequent registration fee is =0.1+2.9*(1-5000/(5000+registration sequence))^2. The registration fees of all participants will enter the prize pool.<br data-v-096fa13e> * All participants&#39; registration fees will go into the prize pool;<br data-v-096fa13e> * Registration number shall be subject to the order of payment in the contract;<br data-v-096fa13e></div></div><p class="t" data-v-096fa13e>2. Competition Rules:</p><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>2.1</div><div class="flex-item" data-v-096fa13e> Challenge rules<br data-v-096fa13e> The first user who signs up initially will become the master, and the users who sign up later will challenge the master one by one in the order of registration. If the challenge to the master is successful, it will take over and become the master. Continue to fight in this order. During the ongoing battle, the hero&#39;s HP cannot be restored.<br data-v-096fa13e></div></div><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>2.2</div><div class="flex-item" data-v-096fa13e> Points rules<br data-v-096fa13e> In the course of the battle, one point is awarded for each defeat of an opponent, and 2 points are awarded for the defeat of the battle. The accumulated points of all participating heroes at the same address are calculated. For every 1000 challenges, the points earned by participating users will increase by 10%<br data-v-096fa13e></div></div><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>2.3</div><div class="flex-item" data-v-096fa13e> When a hero has taken the home court of the ring for more than 30 minutes and there are no challengers, the ring match ends and rewards will be given to all participants.<br data-v-096fa13e></div></div><p class="t" data-v-096fa13e>3. Prize Pool</p><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>3.1</div><div class="flex-item" data-v-096fa13e> The prize pool of the Challenger Competition will be distributed according to the following proportions: <br data-v-096fa13e> Prize Pool: The prize pool allocated at the end of the ring. 90% of the user registration fee will enter the prize pool. At the end of the Challenger Competition, it will be distributed according to the following proportions:<br data-v-096fa13e> Jackpot — 40%: The final championship reward. <br data-v-096fa13e> Participation prize pool — 30%: All participants will be distributed according to the proportion of participating points <br data-v-096fa13e> 20%: Enter the initial prize pool of the next round of Challenger Competition. <br data-v-096fa13e> 10%: Burn to destroy. <br data-v-096fa13e> In the very first round of the Challenger Competition, the team will inject 20,000 BNX into the prize pool as the initial prize pool.<br data-v-096fa13e></div></div><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>3.2</div><div class="flex-item" data-v-096fa13e> Quick dividend pool: 10% of the user registration fee enters the quick dividend pool. Every 1,000 heroes sign up, a quick dividend pool will be allocated, and the current balance of the quick dividend pool will be distributed to all users who have participated.<br data-v-096fa13e></div></div><p class="t" data-v-096fa13e>4. Supplementary Rules:</p><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>4.1</div><div class="flex-item" data-v-096fa13e> The initial battle interval is 30s, and the countdown to wait for the challenger is 30 minutes.<br data-v-096fa13e></div></div><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>4.2</div><div class="flex-item" data-v-096fa13e> After the end of the Challenger Competition, the project team will confirm the results of the competition. If the competition ends normally, the competition will end according to the rules and rewards will be issued. If the abnormal end is caused by BSC network failure, malicious attacks by others, etc., the original will be retained. The result of the game and restart a countdown waiting for the challenger;<br data-v-096fa13e></div></div><div class="flex" data-v-096fa13e><div class="l" data-v-096fa13e>4.3</div><div class="flex-item" data-v-096fa13e> According to the progress of the game, the team reserves the right to adjust the battle interval and the countdown time waiting for the challenger. During the adjustment, the community and the Announce channel will be synchronized in advance for notification.<br data-v-096fa13e></div></div>',
